import React from "react";
import Inputs from "./Inputs_auth";
import { CheckBoxInput } from "./CheckBoxInput_auth";

export const FormControl = (props) => {
  switch (props.control) {
    case "input":
      return <Inputs {...props} />;
    case "checkbox":
      return <CheckBoxInput {...props} />;
  }
};
